import React, { useContext } from 'react';
import { SharedStateContext } from './_SharedStateComponent';

import AppletViewAll from './applet_views/Applet-ViewAll';
import AppletAddNew from './applet_views/Applet-AddNew';

function Applet() {  

  const { appletViewState } = useContext(SharedStateContext);

  return (
    <div id="applet-window">

      {appletViewState === "home" ? (
        <></>
      ) : (
        <></>
      )}

      {appletViewState === "clients" ? (
        <AppletViewAll />
      ) : (
        <></>
      )}

      {appletViewState === "new-client" ? (
        <AppletAddNew />
      ) : (
        <></>
      )}

    </div>
  );
}

export default Applet;
